{"language":"Solidity","sources":{"qu.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title Base Detective - on-chain record of completed investigations
/// @notice Records only the *final* result after a user finishes the quiz.
/// @dev Designed for Farcaster Miniapp, single transaction per user completion.
contract BaseDetective {
    struct Result {
        uint256 caseId;      // ID of the case (quest)
        uint256 score;       // Player's final score
        uint256 timestamp;   // When the case was completed
    }

    mapping(address => Result) public playerResults;
    mapping(address => bool) public hasCompleted;

    event CaseCompleted(address indexed player, uint256 caseId, uint256 score, uint256 timestamp);

    /// @notice Record a player's final result (only once per completion)
    /// @param caseId The ID of the case or quest
    /// @param score The user's final score (0–100 or similar)
    function completeCase(uint256 caseId, uint256 score) external {
        require(score > 0, "Invalid score");
        require(score <= 100, "Score too high");

        playerResults[msg.sender] = Result({
            caseId: caseId,
            score: score,
            timestamp: block.timestamp
        });

        hasCompleted[msg.sender] = true;

        emit CaseCompleted(msg.sender, caseId, score, block.timestamp);
    }

    /// @notice Get player result
    /// @param player Address of the user
    function getResult(address player)
        external
        view
        returns (uint256 caseId, uint256 score, uint256 timestamp)
    {
        Result memory r = playerResults[player];
        return (r.caseId, r.score, r.timestamp);
    }

    /// @notice Allow user to reset progress and replay (optional)
    function reset() external {
        delete playerResults[msg.sender];
        hasCompleted[msg.sender] = false;
    }
}
